Charlotte Hornets NBA Logoman 59FIFTY Cap<br><br>ニューエラ（New Era）は、フィットサイズキャップ製造し、世界で最も愛され続けている高品質キャップブランドの象徴となっています。<br><br>Eminem キムタクや嵐の櫻井翔さんなど世界中の有名人などに愛用され、ストリート・ファッションアイテムとして爆発的な人気を獲得。またプロスポーツでの使用に耐えうる高品質なキャップを実現し、独占的にMLB全選手が試合で着用されています。<br><br>偽物が数多く出回っているブランドですが弊社で取り扱っているNew Eraの製品はアメリカの正規ルートで仕入れておりますので100%本物でございます。<br><br>素材：Made of 70% Acrylic  Woven  30% Wool  Woven<br><br>色：ブラック<br><br></DIV>
<style type="text/css">



/***買い物かごまわり全ボタン・入力欄共通
input{
background:url() no-repeat;
border:none;
}***/

/* お買い物かごボタンの大きさ */
td > input {
font-size: 14px;
font-weight:bold;
width: auto;
height:50px;
padding:22px 60px;
border:none;
color:#fff;
margin-top:0px; 
margin-bottom:0px;
background:url(http://image.rakuten.co.jp/mars405/cabinet/aw1412-/kago-btn.jpg) no-repeat;
}

/***「個数」部分***/
input#units{
font-size: 20px;
font-weight:bold;
border:solid #ccc 1px;
 color:#000;
background:#fff;

text-align:center;
margin-top:15px; margin-bottom:15px;
padding:4px 5px 4px 5px;
}

/***「お問合せ」ボタン
font input{
width:203px;
height:60px;
background:url() no-repeat;
padding:10px 10px 10px 52px;
margin-bottom:15px;
}***/

/***「項目選択肢部分」***/
.inventory input{
background:#fff;
}
/***「お気に入りショップ」***/
.favorite {
margin-top:15px; 
margin-bottom:15px;}


</style>

